import { NavBar } from './components/NavBar';

function App() {
  const links = [
    { label: 'Link A', path: ''},
    { label: 'Link b', path: ''},
    { label: 'Link c', path: ''},
    { label: 'Link d', path: ''},
    { label: 'Link d', path: ''},
    { label: 'Link d', path: ''}
  ]
  const user = { fullName: 'John Doe', job: 'dev', profilePicture: 'assets/pp.png' }

  return (
    <div className='h-screen w-screen'>
      <body>
        <NavBar links={links} user={user} />
        <div className='h-[calc(100vh-64px)] w-fit bg-slate-50 text-[#868e97]  flex flex-col justify-content-center justify-between text-center overflow-auto'>
          <div className='w-screen py-6 px-12 flex justify-between'>
            <div className='flex flex-col space-y-3.5'>
              <p className='text-l text-gray-600'>Home / <b>{links[0].label}</b></p>
              <p className='text-4xl font-semibold text-gray-800'>{links[0].label}</p>
            </div>
            <button className='rounded-lg bg-orange-500 text-white font-semibold py-2.5 px-6 h-fit'>
              Export
            </button>
          </div>
        </div>
      </body>
    </div>
  );
}

export default App;
